mapper.select:
SELECT
FROM rgaf."AfV113SenkyoShikaku" AS "AfT113SenkyoShikaku" WHERE "AfT113SenkyoShikaku"."shikibetsuCode" in
#{shikibetsu}

INSERT
INTO rgaf."AfT121ZaigaiSenkyoninMeibo"(
"shohonNo"
, "groupCode"
, "tohyokuCode"
, "kokugaiBunruiCode"
, satsu
, page
, gyo
, "shikibetsuCode"
)
VALUES (
#{shohonNo}
, #{groupCode}
, #{tohyokuCode}
, #{kokugaiBunruiCode}
, #{satsu}
, #{page}
, #{gyo}
, #{shikibetsuCode}
)

( SELECT 0 as "type", , , ,
FROM rgaf."AfT100Shohon" AS "AfT100Shohon" LEFT JOIN rgaf."AfT111Senkyo" AS "AfT111Senkyo" ON "AfT100Shohon"."shohonNo" = "AfT111Senkyo"."shohonNo" LEFT JOIN rgaf."AfT112SenkyoninMeibo" AS "AfT112SenkyoninMeibo" ON "AfT100Shohon"."shohonNo" = "AfT112SenkyoninMeibo"."shohonNo" LEFT JOIN rgaf."AfT121ZaigaiSenkyoninMeibo" AS "AfT121ZaigaiSenkyoninMeibo" ON "AfT121ZaigaiSenkyoninMeibo"."shohonNo" = "AfT100Shohon"."shohonNo"
LIMIT 1 ) UNION ALL ( SELECT 1 as "type", , , ,
FROM rgaf."AfT100Shohon" AS "AfT100Shohon" INNER JOIN rgaf."AfT111Senkyo" AS "AfT111Senkyo" ON "AfT100Shohon"."shohonNo" = "AfT111Senkyo"."shohonNo"
) UNION ALL ( SELECT 2 as "type", , , ,
FROM rgaf."AfT100Shohon" AS "AfT100Shohon" INNER JOIN rgaf."AfT112SenkyoninMeibo" AS "AfT112SenkyoninMeibo" ON "AfT100Shohon"."shohonNo" = "AfT112SenkyoninMeibo"."shohonNo"
) UNION ALL ( SELECT 3 as "type", , , ,
FROM rgaf."AfT100Shohon" AS "AfT100Shohon" INNER JOIN rgaf."AfT121ZaigaiSenkyoninMeibo" AS "AfT121ZaigaiSenkyoninMeibo" ON "AfT121ZaigaiSenkyoninMeibo"."shohonNo" = "AfT100Shohon"."shohonNo"
)

WITH master as ( SELECT "AfT100Shohon"."shohonNo" AS "shohonNo" FROM rgaf."AfT100Shohon" AS "AfT100Shohon"
)
DELETE FROM rgaf."AfT112SenkyoninMeibo" WHERE "shohonNo" IN (SELECT "shohonNo" FROM master)

WITH master as ( SELECT "AfT100Shohon"."shohonNo" AS "shohonNo" FROM rgaf."AfT100Shohon" AS "AfT100Shohon"
)
DELETE FROM rgaf."AfT111Senkyo" WHERE "shohonNo" IN (SELECT "shohonNo" FROM master)

WITH master as ( SELECT "AfT100Shohon"."shohonNo" AS "shohonNo" FROM rgaf."AfT100Shohon" AS "AfT100Shohon"
)
DELETE FROM rgaf."AfT121ZaigaiSenkyoninMeibo" WHERE "shohonNo" IN (SELECT "shohonNo" FROM master)

